def compute_rate():
	for i in range(4):
		for seed in [100, 200, 300, 400, 500, 600, 700, 800]:
			name = 'cwru_src_{}_seed_{}'.format(i, seed)
			arch = eval(name)
			print(name, 1 - sum(arch.features[0]) / 288)
	
	for i in range(4):
		for seed in [100, 200, 300, 400, 500, 600, 700, 800]:
			name = 'paderborn_src_{}_seed_{}'.format(i, seed)
			arch = eval(name)
			print(name, 1 - sum(arch.features[0]) / 288)
	
	for i in range(10):
		name = 'random_{}'.format(i)
		arch = eval(name)
		print(name, 1 - sum(arch.features[0]) / 288)
			

def random_genotypes():
	for i in range(5):
		np.random.seed(i * 1993)    # 20
		gene_normal = np.random.choice(INCEPTION, 4)
		gene_reduce = np.random.choice(INCEPTION, 2)
		gene_features = []
		a = 0.5
		for f in range(288):
			np.random.seed(i * 1993 + f)    # 1000
			if np.random.rand() < a:
				gene_features.append(0.)
			else:
				gene_features.append(1.)
		genotype = Genotype(
			normal=gene_normal.tolist(),
			reduce=gene_reduce.tolist(),
			features=[gene_features]
		)
		print(genotype)


